
DROP TABLE IF EXISTS FriendList;
DROP TABLE IF EXISTS Users;

CREATE TABLE Users(
    id SERIAL PRIMARY KEY,
    username TEXT NULL,
    password TEXT NULL,
    auth_id TEXT NULL,
    firstname TEXT NULL,
    lastname TEXT NULL,
    gender TEXT NULL,
    haircolor TEXT NULL,
    eyecolor TEXT NULL,
    hobby TEXT NULL,
    birthmonth TEXT NULL,
    birthday INTEGER NULL,
    birthyear INTEGER NULL,
    image TEXT NULL
);

CREATE TABLE FriendList(
    user_id TEXT NULL,
    friend_id INTEGER NOT NULL
);


